import React from 'react';
import cl from './MyModal.module.css'

const MuModal = ({ children }) => {
	return (
		<div className={[cl.MuModal, cl.active].join(' ')}>
			<div className={cl.MuModalContent}>{children}</div>
		</div>
	);
};

export default MuModal;
